import React from 'react';
import '../styles/App.css';
import Logo from './Logo';
import Email from './Email';
import Password from './Password';
import SignUpPageTitle from './SignUpPageTitle';
import CheckboxTerms from './CheckboxTerms';
import SignUpButton from './SignUpButton';
import GoBackButton from './GoBackButton';
import { Link } from 'react-router-dom';

export default function SignUpContainer() {
  const [state, setState] = React.useState({
    email: '',
    password: '',
    terms: false,
  });
  const sendDataToServer = async () => {
    await fetch('http://localhost:5000/api/auth/login', {
      method: 'POST',
      headers: {
        'content-type': 'application/json',
      },
      body: JSON.stringify({}),
    });
  };
  const handleCheckboxClick = (e) => {};
  return (
    <div className='App-Container'>
      <Logo />
      <SignUpPageTitle />
      <input className='Email form-control mb-4' placeholder='Email:' type='text' id='todo-item' />
      <input className='Password form-control mb-4' placeholder='Password:' type='text' id='todo-item' />
      <input
        id='checkbox'
        type='checkbox'
        name='agreeToTerms'
        defaultChecked={state.terms}
        onClick={(e) => handleCheckboxClick(e)}
      />
      <label className='Agree'>&nbsp; &nbsp;I agree to the</label>
      <Link to='/termsandconditions'>&nbsp;terms and conditions</Link>
      {/* <Email />
      <Password />
